function tab(e){for(var t=e.parentNode,s=t.getElementsByTagName("li"),i=0;i<s.length;i++){var a=s[i],c=document.getElementById(a.id+"_content");a.id==e.id?(a.className="tab_active",c&&(c.className="tab_content visible")):(a.className="",c&&(c.className="tab_content"))}}var gulp=require("gulp"),concat=require("gulp-concat"),uglify=require("gulp-uglify"),cleanCSS=require("gulp-clean-css");gulp.task("scripts",function(){return gulp.src(["*.js"]).pipe(concat("all.min.js")).pipe(uglify()).pipe(gulp.dest("dist"))}),gulp.task("minify-css",function(){return gulp.src(["*.css"]).pipe(concat("all.minify.css")).pipe(cleanCSS()).pipe(gulp.dest("dist"))}),gulp.task("default",["scripts","minify-css"]);